class AVBYtmpJob implements ShouldQueue
{
    use Dispatchable, InteractsWithQueue, Queueable, SerializesModels;
    use LoggerAwareTrait;

    public $timeout = 240;

    private $length = 5;
    private $offset;
    private $doc;

    public function __construct(int $offset = 0)
    {
        $this->offset = $offset;
        $this->doc = new HtmlWeb();
    }

    public function handle() : void
    {
        $this->setLogger();

        $links = $this->getLinks();
        if(!$links){
            $this->logger->info('null links. return');
            return;
        }

        $this->logger->info('ITERATION '.$this->offset);

        try{
            foreach($links as $link){
                $link = $link->link;
                $this->logger->debug('try link '.$link);
                $page = 1;
                $prices = [];
                do{
                    $this->logger->debug('page '.$page);
                    $html = $this->doc->load($link . "&page=$page");
                    if(!$html){
                        $this->logger->error('unable to load page, continue');
                        continue 2;
                    }
                    $priceContainers = $html->find('div.listing-item__priceusd');
                    foreach($priceContainers as $priceContainer){
                        $prices[] = (int)preg_replace('/\D/','', $priceContainer->innertext);
                    }
                    $next = $html->find('a[rel=next]', 0);
                    if($next)$page++;
                    $this->logger->debug("memory: ".memory_get_usage());

                }while($next);
                $this->logger->debug('end for this link');
                $ad_count = count($prices);
                $cost = null;
                if($ad_count > 20){
                    $cost = array_sum($prices) / $ad_count;
                }
                $this->logger->debug("end for this link. count = $ad_count, av_cost = $cost");
                DB::select('UPDATE avby SET ad_count = ?, average_cost = ? WHERE link = ?', [$ad_count, $cost, $link]);
            }
        } catch (Throwable $e){
            $this->logger->error($e->getMessage(). ' at line '.$e->getLine());
            $this->logger->debug('return');
            return;
        }



        self::dispatch(++$this->offset);

    }

